import Menu from "./components/Menu";
import LeftSide from "./components/LeftSide";
import RightSide from "./components/RightSide";

function App() {
  return (
    <div className="App">
      <Menu></Menu>
      <Row className = "landing">
        <Col><LeftSide></LeftSide></Col>
        <Col><RightSide></RightSide></Col>
      </Row>
    </div>
  );
}

export default App;
